// ...existing code...
<script>
(function(){
  const footer = document.querySelector('footer');
  if (!footer) return;
  const THRESHOLD = 400; // pixels scrolled down before footer appears
  let shown = false;
  function onScroll(){
    const shouldShow = window.scrollY > THRESHOLD;
    if (shouldShow === shown) return;
    shown = shouldShow;
    footer.classList.toggle('visible', shouldShow);
    document.body.classList.toggle('footer-visible', shouldShow);
  }
  window.addEventListener('scroll', onScroll, { passive: true });
  // initial check
  onScroll();
})();
</script>
</body>
</html>
